import { useState } from "react";
import Loading from "../utils/Loading";

class Other extends Loading {

    constructor() {
        super();
        this.state = {...this.state, text: 'LOL'}
        setTimeout( () => { setText("LOOOOOOL") }, 3000)
        this.hasLoaded()
    }

    setText (string) {
        this.setState({ text: string })
    }

    renderLoaded () {
        <p>{this.state.text}</p>
    }

}

export default Other;
